BEGIN


IF(IS_DUMMY_CYCLE) THEN


/*
  CALL DUMMY_CHECK_POSITIONS(
  DATE_SUB(CURRENT_TIME_IN, INTERVAL 1 MINUTE)
  ,INTERVAL_SECONDS_IN);
*/

  CALL DUMMY_CHECK_POSITIONS(CURRENT_TIME_IN,INTERVAL_SECONDS_IN);

